eval("(function() {\n\n// Kick off Ember\nCCAdmin = Ember.Application.create({\n    rootElement: '#application',\n});\n\nFixtures = Ember.Object.create({\n    letters: 'ABCDEFGHIJKLMNOPQRSTUVWXYZ'.split(''),\n    searchLimit: 15,\n    queryBy: {\n        artists: 'name',\n        songs: 'title'\n    }\n});\n\n// Components\nCCAdmin.Select2Component = Ember.TextField.extend({\n    attributeBindings: ['objectQuery'],\n    didInsertElement: function() {\n        var items = this.get('value');\n        var objectQuery = this.get('objectQuery');\n        var options = {\n            width: 'element',\n            tags: [],\n            tokenSeparators: [',']\n        };\n\n        if (!Ember.isNone(objectQuery)) {\n            options.query = function(query) {\n                dpd(objectQuery).get({name: {$regex:  '(?i)' + query.term + '\\w*'}}, function(result, error) {\n                    if (!Ember.isEmpty(result)) {\n                        query.callback({ results : result.map(function(item) { return { id: item.name, text: item.name }}) });\n                    } else {\n                        query.callback({ results : []});\n                    }\n\n                    if (!Ember.isNone(error)) {\n                        console.log(error);\n                    }\n                });\n            };\n\n            options.initSelection = function(e, callback) {\n                callback(items.split(',').map(function(item) { return { id: item, text: item}}));\n            };\n\n            options.createSearchChoice = function(term, data) {\n                if ($(data).filter(function() { \n                    return this.text.localeCompare(term)===0; \n                }).length===0) {\n                    return {\n                        id : '(new)' + term,\n                        text : term\n                    }\n                }\n            };\n        } else {\n            options.dropdownCss = { display: 'none' };\n        }\n\n        this.$().select2(options);\n    }\n});\n\n// Views\nCCAdmin.MainView = Ember.View.extend({\n    click: function() {\n        this.get('controller').send('clearEdits');\n    }\n});\n\n// Controllers\nCCAdmin.MainController = Ember.ObjectController.extend({\n\n});\n\nCCAdmin.ItemsController = Ember.ArrayController.extend({\n    isNextDisabled: function() {\n        return this.get('hasNext') === false;\n    }.property('hasNext'),\n    isPrevDisabled: function() {\n        return Ember.isNone(this.get('skipValue')) || this.get('skipValue') <= 0;\n    }.property('skipValue'),\n    hasNew: function() {\n        return this.anyBy('isNew', true);\n    }.property('[]'),\n    isSortByArtists: function() {\n        return this.get('sortBy') === 'artists';\n    }.property('sortBy'),\n    isSortByTitle: function() {\n        return this.get('sortBy') === 'title';\n    }.property('sortBy')\n});\n\nCCAdmin.LetterController = Ember.ObjectController.extend({\n    isFilter: function() { \n        return this.get('parentController').get('letterFilter') === this.get('content');\n    }.property('parentController.letterFilter')\n});\n\n})();//@ sourceURL=adminApp/ccAdminApp.js")

eval("(function() {\n\nCCAdmin.SongController = Ember.ObjectController.extend({\n    artistsDisplayText: function() {\n        return this.get('artists').getEach('name');\n    }.property('artists'),\n    displayTextEdit: function() {\n        var artists = this.get('artistsEdit') || '';\n        var title = this.get('titleEdit') || '';\n\n\n        if (Ember.isEmpty(artists) && Ember.isEmpty(title)) {\n            return '';\n        } else {\n            var artistText = '';\n            var artistsArray = artists.split(',');\n\n            artistsArray.forEach(function(artist, index, artists) {\n                artist = artist.replace('(new)', '');\n                if (index === 0) {\n                    artistText += artist;\n                } else if (index === 1) {\n                    artistText += ' ft. ' + artist;\n                } else if (index === artists.length - 1) {\n                    artistText += ' and ' + artist;\n                } else {\n                    artistText += ', ' + artist;\n                }\n            });\n            return artistText + ' - ' + title;\n        }\n    }.property('artistsEdit', 'titleEdit'),\n    actions: {\n        clickEdit: function() {\n            if (this.get('isNew') !== true) {\n                this.send('clearEdits');\n                this.setProperties({\n                    isEdit: true,\n                    displayTextEdit: this.get('displayText'),\n                    artistsEdit: !Ember.isNone(this.get('artists')) ? this.get('artists').join(',') : '',\n                    titleEdit: this.get('title'),\n                    tagsEdit: !Ember.isNone(this.get('tags')) ? this.get('tags').join(',') : ''\n                });\n            }\n        },\n        clickDone: function(addAnother) {\n            var displayTextEdit = this.get('displayTextEdit');\n            var artistsEdit = this.get('artistsEdit');\n            var titleEdit = this.get('titleEdit');\n            var tagsEdit = this.get('tagsEdit');\n\n            this.setProperties({\n                displayTextError: Ember.isEmpty(displayTextEdit),\n                artistsError: Ember.isEmpty(artistsEdit),\n                titleError: Ember.isEmpty(titleEdit),\n                doneError: Ember.isEmpty(displayTextEdit) || Ember.isEmpty(artistsEdit) || Ember.isEmpty(titleEdit) ?\n                                    'You\\'re missing some info, see the red fields.' : undefined\n            });\n\n            if (!Ember.isEmpty(displayTextEdit) && !Ember.isEmpty(artistsEdit) && !Ember.isEmpty(titleEdit)) {\n                var self = this;\n\n                this.setProperties({\n                    isEdit: undefined,\n                    isNew: undefined,\n                    displayTextError: undefined,\n                    artistsError: undefined,\n                    titleError: undefined,\n                });\n\n                dpd.songs.post({\n                    id: this.get('id'),\n                    displayText: displayTextEdit,\n                    artists: artistsEdit.split(','),\n                    title: titleEdit,\n                    tags: !Ember.isEmpty(tagsEdit) ? tagsEdit.split(',') : []\n                }, function(result, error) {\n                    if (!Ember.isNone(error)) {\n                        console.log(error);\n                    }\n\n                    if (!Ember.isNone(result)) {\n                        self.setProperties({\n                            id: result.id,\n                            artists: result.artists,\n                            displayText: result.displayText,\n                            title: result.title,\n                            tags: result.tags\n                        });\n                    }\n\n                    if (addAnother === \"true\") {\n                        self.send('clickAdd');\n                    }\n                });\n            }\n        },\n        clickDelete: function(obj) {\n            var parentController = this.get('parentController');\n            dpd.songs.del(this.get('id'), function(result, error) {\n                if (!Ember.isNone(result)) {\n                    \n                    parentController.removeObject(obj);\n\n                    if (parentController.get('content').length === 0) {\n                        if (parentController.get('isNextDisabled') === false) {\n                            parentController.set('skipValue', parentController.getWithDefault('skipValue', 0) - Fixtures.get('searchLimit'));\n                            parentController.send('clickNextPage');\n                        } else if (parentController.get('isPrevDisabled') === false) {\n                            parentController.send('clickPrevPage');\n                        }\n                    }\n                }\n            });\n        }\n    }\n});\n\n})();//@ sourceURL=adminApp/ccAdminSong.js")

eval("(function() {\n\n\nCCAdmin.ArtistController = Ember.ObjectController.extend({\n    actions: {\n        clickEdit: function() {\n            if (this.get('isNew') !== true) { // To prevent weirdness when clicking on a new artist's row.\n                this.send('clearEdits');\n                this.setProperties({\n                    isEdit: true,\n                    nameEdit: this.get('name'),\n                    tagsEdit: !Ember.isNone(this.get('tags')) ? this.get('tags').join(',') : ''\n                });\n            }\n        },\n        clickDone: function(addAnother) {\n            if (Ember.isEmpty(this.get('nameEdit'))) {\n                this.setProperties({\n                    'has-error' : true,\n                    doneError : 'Artist name can not be blank'\n                });\n            } else {\n                var self = this;\n\n                dpd.artists.post({\n                    id: this.get('id'),\n                    name: this.get('nameEdit'),\n                    tags: !Ember.isEmpty(this.get('tagsEdit')) ? this.get('tagsEdit').split(',') : []\n                }, function(result, error) {\n                    if (!Ember.isNone(result)) {\n                        self.setProperties(result);\n                        self.setProperties({\n                            'has-error': undefined,\n                            isEdit: undefined,\n                            isNew: undefined,\n                        });\n                        self.parentController.notifyPropertyChange('[]');\n                        if (addAnother === \"true\") {\n                            self.send('clickAdd');\n                        }\n                    }\n\n                    if (!Ember.isNone(error)) {\n                        self.setProperties({\n                            'has-error' : true,\n                            doneError: error.message,\n                        });\n                    }\n                });\n            }\n        },\n        clickDelete: function(obj) {\n            var parentController = this.get('parentController');\n            dpd.artists.del(this.get('id'), function(result, error) {\n                if (!Ember.isNone(result)) {\n                    \n                    parentController.removeObject(obj);\n                    console.log(parentController)\n                    if (parentController.get('content').length === 0) {\n                        if (parentController.get('isNextDisabled') === false) {\n                            parentController.set('skipValue', parentController.getWithDefault('skipValue', 0) - Fixtures.get('searchLimit'));\n                            parentController.send('clickNextPage');\n                        } else if (parentController.get('isPrevDisabled') === false) {\n                            parentController.send('clickPrevPage');\n                        }\n                    }\n                }\n            });\n        }\n    }\n});\n\n})();//@ sourceURL=adminApp/ccAdminArtist.js")

